import React from 'react';
import './AboutPage.css';

function AboutPage() {
  return (
    <div className="about-page">
      <h1>About Project</h1>
      <section className="bio-section">
        {/* Replace with your actual bio */}
        <p>
          FrontEND: React<br/>
          API: REST<br/>
          BackEnd: <br/>
        </p>
         {/* Optional: Add another paragraph about hobbies or future goals */}
      </section>

    </div>
  );
}

export default AboutPage;
